import React, {Component} from 'react';
import './styles.scss';


class RegisterLeft extends Component{
  render(){
    return (
	    <div>
	      	<div className="col-md-12 Regis-Left">
				<div className="Sign-up">
					<h2>SIGN UP</h2>
					<form className="formSign" action="profile" method="Post">
						Email:<br />
						<input className="Email" placeholder="" type="text"  name ="userEmail" required=""></input>
						<br />
						Password:<br />
						<input className="Pass" placeholder="" type="password"  name ="pws" required=""></input>
						<br />
						Confirm Password:<br />
						<input className="ConfirmPass" placeholder="" type="password"  name ="pws" required=""></input>
					</form>
					<button type="button" className="btn btn-default sign-up">SIGN UP</button>
					<p>&copy; 2019 Terralogic.Inc</p>
				</div>
			</div>
	    </div>
  );
  }
}

export default RegisterLeft;
